B.HX=new A.f8("Kebijakan Privasi\n\n1. Pengumpulan Informasi\nKami mengumpulkan informasi pribadi yang Anda berikan secara sukarela saat mendaftar di situs kami, seperti nama, alamat email, dan informasi kontak lainnya.\n\n2. Penggunaan Informasi\nInformasi yang kami kumpulkan digunakan untuk:\n- Memberikan layanan dan dukungan pelanggan.\n- Meningkatkan layanan kami.\n- Mengirimkan informasi terkait kursus dan promosi.\n\n3. Pembagian Informasi\nKami tidak akan menjual, memperdagangkan, atau memindahkan informasi pribadi Anda kepada pihak ketiga tanpa persetujuan Anda, kecuali jika diwajibkan oleh hukum.\n\n4. Keamanan Informasi\nKami menggunakan berbagai langkah keamanan untuk menjaga keamanan informasi pribadi Anda. Namun, kami tidak dapat menjamin keamanan absolut dari informasi tersebut.\n\n5. Perubahan Kebijakan Privasi\nKami dapat mengubah kebijakan privasi ini dari waktu ke waktu. Setiap perubahan akan diberitahukan melalui situs web kami atau melalui email.\n",null,B.al,null)
B.HY=new A.f8("\n\nSyarat & Ketentuan\n",null,B.al,B.hN)
B.I1=new A.f8("Syarat & Ketentuan\n\n1. Penerimaan Syarat\nDengan menggunakan situs web kami, Anda setuju untuk mematuhi dan terikat oleh syarat dan ketentuan ini.\n\n2. Layanan Kami\nKami menyediakan kursus komputer online yang dapat diakses oleh pengguna yang telah mendaftar dan membayar (jika diperlukan) biaya kursus.\n\n3. Hak Cipta\nSemua konten di situs ini, termasuk teks, gambar, dan materi video, adalah milik 25Chris Coding Tutorial dan dilindungi oleh undang-undang hak cipta. Dilarang menyalin atau mendistribusikan konten tanpa izin tertulis dari kami.\n\n4. Tanggung Jawab Pengguna\nPengguna bertanggung jawab untuk menjaga kerahasiaan akun dan kata sandi mereka. Pengguna setuju untuk tidak menyalahgunakan layanan kami dengan cara apa pun.\n\n5. Perubahan Layanan\nKami berhak untuk mengubah atau menghentikan layanan kami kapan saja tanpa pemberitahuan sebelumnya.\n",null,B.al,null)
B.HZ=new A.f8("\n\nKetentuan Pengguna\n",null,B.al,B.hN)
B.I_=new A.f8("Ketentuan Pengguna\n\n1. Pendaftaran Pengguna\nUntuk mengakses kursus, pengguna harus mendaftar dengan menyediakan informasi yang akurat dan lengkap. Pengguna bertanggung jawab untuk memperbarui informasi tersebut jika ada perubahan.\n\n2. Pembayaran\nJika ada biaya untuk kursus, pengguna harus membayar sesuai dengan ketentuan yang berlaku. Pembayaran dapat dilakukan melalui metode yang telah disediakan di situs web kami.\n\n3. Penggunaan Konten\nPengguna hanya diperbolehkan menggunakan konten kursus untuk penggunaan pribadi dan tidak komersial. Pengguna dilarang membagikan atau menjual kembali konten kursus.\n\n4. Pelanggaran\nJika pengguna melanggar ketentuan ini, kami berhak untuk menonaktifkan akun pengguna dan mengambil tindakan hukum yang diperlukan.\n\n5. Batasan Tanggung Jawab\nKami tidak bertanggung jawab atas kerugian atau kerusakan yang timbul dari penggunaan situs web kami atau konten kursus.\n",null,B.al,null)
